import React, { Component } from 'react';
import EmployeeDataService from "./components/EmployeeDataService";

class Employees extends Component {

    constructor(props) {
        super(props)
        this.state = {
            employees: [],
            message: null
        }
        this.refreshEmployees = this.refreshEmployees().bind(this)
    }

    componentDidMount() {
        this.refreshEmployees();
    }

    refreshEmployees() {
        EmployeeDataService.refreshEmployees
            .then(
                response => {
                    console.log(response);
                    this.setState({ employees: response.data })
                }
            )
    }


    render(){
        return(
            <div className="container">
                <table className="table table-striped">
                    <thead>
                    <tr>
                        <th>Name</th>
                        <th>Last name</th>
                        <th>Middle name</th>
                        <th>email</th>
                    </tr>
                    </thead>
                    <tbody>
                    {
                        this.state.employees.map(
                            employee =>
                                <tr key={employee.id}>

                                </tr>
                        )
                    }
                    </tbody>

                </table>
            </div>
        )

    }
}

export default Employees
